import React from 'react';
import './App.css';


import Header from './component/Header/index';
import {
  BrowserRouter,
  Switch,
  Route,
  Link
} from "react-router-dom";

interface Props{

}

type State = typeof initState;

const initState = {
  string: "Hello my friend" as string
}

class App extends React.Component<Props,State>{
  state= initState;

  path:string[] = ["/","/about-us","/documents","/git"];
  renderSwitch = () => {
    return <Switch>
      this.path.map((val)=>{
        <Route exact path={val}>
          <div>{val}</div>
        </Route>
      })  
          </Switch>
  }

  render(){
    return(
      <BrowserRouter>
        <div className="App">
          <Header/>
        </div>
        {this.renderSwitch()}
      </BrowserRouter>

    );
  }
}

export default App;
